{
  "name": "長さ",
  "description": "mm単位の数値、変数要素名,式文字列、例) \"100.0\" , \"L1\", \"L1 / 2.0\""
}

{
  "name": "角度",
  "description": "度(°)単位の数値、変数要素名,式文字列、例) \"30.0\" , \"Angle1\" , \"Angle1 * 0.2\""
}

{
  "name": "平面",
  "description": "カンマ区切りの文字列。最初のカラムは必ず\"PL\"。次のカラムが\"O\"の場合はオフセット距離、以降はXY平面指定やフェイス指定等"
}

{
  "name": "点",
  "description": "カンマ区切りで各コンポーネントをX, Y, Z（3Dの場合）として長さ、変数名、式文字列などで指定。例) \"100.0,50,0,0.0\""
}

{
  "name": "方向",
  "description": "各軸方向を+X, -X, +Y, -Y, +Z, -Z の形で指定。カンマ区切りでX, Y, Z成分を数値または変数名で指定"
}

{
  "name": "点・方向・平面その他",
  "description": "範囲、数値、要素グループ、注記スタイル、材料、スイープ方向、モールド位置、オペレーションタイプ、関連設定、形状タイプ、形状パラメータ、要素等の各種型の説明は本文参照"
}

{
  "name": "要素グループ",
  "description": "EVO.SHIPの要素グループ名。階層は\"/\"で区切る"
}

{
  "name": "注記スタイル",
  "description": "EVO.SHIPに設定している注記スタイルの名称"
}

{
  "name": "材料",
  "description": "EVO.SHIPに設定している材料の名称"
}

{
  "name": "スイープ方向",
  "description": "\"N\" 順方向, \"R\" 反対方向, \"B\" 両方向, \"2\" 2方向, \"T\" 貫通"
}

{
  "name": "厚み付けタイプ",
  "description": "\"+\" 内側, \"-\" 外側, \"B\" 両方向, \"2\" 2方向, \"\" 空文字は厚み付けなし"
}

{
  "name": "モールド位置",
  "description": "\"+\" +側, \"-\" -側, \"\" センター"
}

{
  "name": "オペレーションタイプ　（ボディ）",
  "description": "\"+\" 和, \"-\" 削除, \"*\" 積"
}

{
  "name": "関連設定",
  "description": "ボディ関連として設定する場合は\"B\"、それ以外はフィーチャー関連"
}

{
  "name": "形状タイプ",
  "description": "部材既定寸法設定ファイルで用いる形状番号。例: 1007, 1003, 1101, 1120, 1503 など"
}

{
  "name": "形状パラメータ",
  "description": "各形状タイプの寸法値を文字列配列として設定"
}

{
  "name": "要素",
  "description": "EVO.SHIPの各要素を指定する。ID指定、要素名指定、またはフェイス指定など"
}

